public boolean canClose()
{
    boolean ret;

    ret = super();

    if (ret && countryRegion_LTLV && this.closedOk())
    {
        if (enableAutoNumbering && !docNumberingCode_LT.text())
        {
            ret = checkFailed(strFmt("@SYS26332", fieldPName(LtInvoiceAutoNumberingTable, NumberingCode)));
        }

        if (enableAutoNumbering && docNumberingCode_LT.text() &&
            !LtInvoiceAutoNumberingTable::existUserNumbering(docNumberingCode_LT.text(),
                                                            DocNumberingModule_W::Inventory,
                                                            LtInvoiceAutoNumberingType::PackingSlip))
        {
            ret = checkFailed(strFmt("@GLS110719", docNumberingCode_LT.text(), curUserId()));
        }

        if (!enableAutoNumbering && !inventTransferparmTable.Num_LT)
        {
            ret = checkFailed(strFmt("@SYS26332", fieldPName(InventTransferParmTable, Num_LT)));
        }
    }

    return ret;
}

