private boolean canCreateReceiveFiscalDocument()
{
    InventTransferTableFiscalInfo_BR    inventTransferTableFiscalInfo;
    InventTransferTable                 inventTransferTable;

    select InventTransferOrderType from inventTransferTableFiscalInfo
        exists join inventTransferTable
            where inventTransferTableFiscalInfo.InventTransferTable == inventTransferTable.RecId
                && inventTransferTable.TransferId == inventTransferParmTable.TransferId;

    return inventTransferTableFiscalInfo.canCreateReceiveFiscalDocument();
}

