                && inventTransferJour.Num_LT == inventTransferParmTable.Num_LT;

        if (inventTransferJour.Num_LT)
        {
            inventTransferParmTable.Num_LT = '';
            throw error(strFmt("@GLS112827", inventTransferJour.Num_LT));
        }
    }

    super();
}

