public void lookup(FormControl _formControl, str _filterStr)
{
    VendAccount         vendAcc;

    switch (officialsTrans_RU.Position)
    {
        case OffPosition_RU::TransRespCarrier:
            this.lookup_CarrierType_W(_formControl);
            break;
        case OffPosition_RU::TransResp :
            if (inventTransferParmTable.TransferType_RU == InventTransferType_RU::ReceiptFromParty &&
                inventTransferParmTable.PartyAccountNum_RU)
            {
                OfficialsTrans_RU::nameLookup(_formControl, false, '', inventTransferParmTable.PartyAccountNum_RU);
            }
            else
            {
                OfficialsTrans_RU::nameLookup(_formControl, true);
            }
            break;
        case OffPosition_RU::TransRespCust :
            if (inventTransferParmTable.TransferType_RU == InventTransferType_RU::Standard)
            {
                vendAcc = InventLocation::find(InventTransferTable::find(inventTransferParmTable.TransferId).InventLocationIdTo).VendAccount;
                if (vendAcc)
                {
                    OfficialsTrans_RU::nameLookup(_formControl, false, '', vendAcc);
                }
                else
                {
                    OfficialsTrans_RU::nameLookup(_formControl, true);
                }
            }
            else if (inventTransferParmTable.TransferType_RU == InventTransferType_RU::IssueToParty &&
               inventTransferParmTable.PartyAccountNum_RU)
            {
                OfficialsTrans_RU::nameLookup(_formControl, false, '', inventTransferParmTable.PartyAccountNum_RU);
            }
            else
            {
                OfficialsTrans_RU::nameLookup(_formControl, true);
            }
            break;

        default:
            OfficialsTrans_RU::nameLookup(_formControl, true);
    }
}

/// <summary>
/// Populates field's lookup according to carrier type.
/// </summary>
/// <param name = "_formControl">Instance of <c>FormControl</c> class.</param>
protected void lookup_CarrierType_W(FormControl _formControl)
{
    switch (bolCarrierType_RU.valueStr())
    {
        case enum2Value(CarrierType_W::Customer) :
            OfficialsTrans_RU::nameLookup(_formControl, false, bolCarrierCode_RU.valueStr(), "");
            break;
        case enum2Value(CarrierType_W::Vendor) :
            OfficialsTrans_RU::nameLookup(_formControl, false, "", bolCarrierCode_RU.valueStr());
            break;
        case enum2Value(CarrierType_W::InvoiceAccount) :
            OfficialsTrans_RU::nameLookup(_formControl, true);
            break;
    }
}

