public void clicked()
{
    Query                       query;
    QueryRun                    queryRun;
    InventTransferParmTable     inventTransferParmTableLocal;
    InventTransferParmTable_IN  inventTransferParmTable_INLocal;

    super();

    query = inventTransferParmTable_ds.query();
    queryRun = new QueryRun(query);

    ttsBegin;
    while (queryRun.next())
    {
        inventTransferParmTableLocal = queryRun.get(tableNum(InventTransferParmTable));
        inventTransferParmTable_INLocal = queryRun.get(tableNum(InventTransferParmTable_IN));
        inventTransferParmTable_INLocal.selectForUpdate(true);
        inventTransferParmTable_INLocal.InventTransferParmTable = inventTransferParmTableLocal.RecId;
        inventTransferParmTable_INLocal.PrintGSTTransferInvoice = this.checked();
        inventTransferParmTable_INLocal.write();
    }
    ttsCommit;

    InventTransferParmTable_ds.executeQuery();
}

public void clicked()
{
    Query query;
    QueryRun queryRun;
    InventTransferParmTable inventTransferParmTableLocal;
    InventTransferParmTable_IN inventTransferParmTable_INLocal;
    InventTransferTable inventTransferTableLocal;

    super();

    query = inventTransferParmTable_ds.query();
    queryRun = new QueryRun(query);

    ttsBegin;

    while (queryRun.next())
    {
        inventTransferParmTableLocal = queryRun.get(tableNum(InventTransferParmTable));
        InventTransferParmTable_INLocal = queryRun.get(tableNum(InventTransferParmTable_IN));

        if (InventTransferParmTable_INLocal.RecId != 0)
        {
            InventTransferParmTable_INLocal.selectForUpdate(true);
        }
        else
        {
            InventTransferParmTable_INLocal.InventTransferParmTable = inventTransferParmTableLocal.RecId;
        }

        if (!this.checked())
        {
            InventTransferParmTable_INLocal.PrintExciseTransferInvoice = false;
        }
        else
        {
            select firstOnly TransferId, TransferType_IN from inventTransferTableLocal
                where inventTransferTableLocal.TransferId == inventTransferParmTableLocal.TransferId;

            if (inventTransferTableLocal.TransferType_IN == TransferType_IN::StockTransfer
                && inventTransferTableLocal.isExcisable_IN())
            {
                InventTransferParmTable_INLocal.PrintExciseTransferInvoice = true;
            }
        }

        if (InventTransferParmTable_INLocal.RecId != 0)
        {
            InventTransferParmTable_INLocal.write();
        }
        else
        {
            InventTransferParmTable_INLocal.insert();
        }
    }

    ttsCommit;

    InventTransferParmTable_ds.executeQuery();
}

